Verenigde Staten
Actie / Avontuur
94 minuten

mooi

met Josh Hutcherson, Dwayne Johnson en Vanessa Hudgens

Het avontuur gaat van start als Sean een noodoproep ontvangt van een geheimzinnig niet bestaand eiland. Het is een plaats met 
vreemde levensvormen, bergen van goud en een groot geheim. Sean gaat samen met zijn stiefvader op onderzoek uit om het eiland 
te vinden en er weer vanaf te komen voordat het eiland zinkt en zijn schatten voor eeuwig verbergt.
